import React from 'react'
import { useSelector } from 'react-redux'


const Confirmation = (props) => {

    const bookedHistory = useSelector(state => state.seats.rsrvInfo)
    console.log(bookedHistory, "array came")

    return (
        bookedHistory.map(item => {
            return (
                <table class="table">
                    <thead>
                        <tr>
                            <th scope="col">Name</th>
                            <th scope="col">Age</th>
                            <th scope="col">Seat No.</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th scope="row">{item.name.name}</th>
                            <td>{item.name.age}</td>
                            <td>{item.seats}</td>
                        </tr>
                    </tbody>
                </table>
            )

        })
    )


}
export default Confirmation;
